"use client";

// REACT
import { useRef, useState, useEffect } from "react";

// LIBRARIES
import { createWorker } from "tesseract.js";
import cv from "@techstark/opencv-js";
import * as pdfjsLib from "pdfjs-dist/build/pdf";
import pdfjsWorker from "pdfjs-dist/build/pdf.worker.entry";

import QRCode from "qrcode";
import { PDFDocument, rgb, StandardFonts, degrees } from "pdf-lib";

// UTILS
import { extractFromInternal } from "../../utils";

import logo from "../../../public/assets/images/pagcor_logo.png";
import { createCanvas, loadImage } from "canvas";

pdfjsLib.GlobalWorkerOptions.workerSrc =
  pdfjsWorker ||
  `//cdnjs.cloudflare.com/ajax/libs/pdf.js/${pdfjsLib.version}/pdf.worker.min.js`;

export default function Tesseract() {
  const [text, setText] = useState("");
  const [file, setFile] = useState(null);
  const [inputFile, setInputFile] = useState(null);
  const [isLoading, setIsLoading] = useState(false);
  const canvasRef = useRef(null);
  const binarizedCanvasRef = useRef(null);
  const imageLoaded = useRef(false);

  const pdfViewerRef = useRef(null);
  const [qrImage, setQrImage] = useState(null);
  const [ocrData, setOcrData] = useState([]);
  const [modifiedPDF, setModifiedPDF] = useState(null);
  const [totalPages, setTotalPages] = useState(1);
  const [pageNumber, setPageNumber] = useState(1);
  const [base64, setBase64] = useState(null);

  useEffect(() => {
    if (file) {
      renderPdfToCanvas(file);
    }
  }, [file]);
  // URL of the PNG image
  const pngUrl =
    "";

  // Data of formatted date and time
  const currentDate = new Date();

  // Format date part (MM/DD/YYYY)
  const formattedDate = currentDate.toLocaleDateString("en-US", {
    month: "2-digit",
    day: "2-digit",
    year: "numeric",
  });

  // Format time part (hh:mm AM/PM)
  const hours = currentDate.getHours();
  const minutes = currentDate.getMinutes();
  const ampm = hours >= 12 ? "PM" : "AM";
  const formattedTime = `${hours === 12 ? 12 : hours % 12}:${minutes
    .toString()
    .padStart(2, "0")} ${ampm}`;

  // Combine date and time parts
  const formattedDateTime = `${formattedDate}, ${formattedTime}`; // Example output: "05/15/2024, 10:48 AM"

  // Data of CTS
  const dateArray = formattedDate.split("/");
  const splitDate = `${dateArray[0]}${dateArray[1]}${dateArray[2]}`;
  const docType = "EGLD";

  // Combine data of CTS
  const ctsNo = `EGLD-415-${splitDate}-0001`;

  // Data of Department
  const department = "EGLD";

  const licensee = "Juan Dela Cruz";
  const OCRData = [
    { data: `Date & Time: ${formattedDateTime}\n`, mode: "byte" },
    { data: `Reference No.: ${ctsNo}`, mode: "byte" },
    { data: `\nLicensee/Applicant: ${licensee}`, mode: "byte" },
    { data: `\nDepartment: ${department}`, mode: "byte" },
    { data: `\nDocument Type: ${docType}`, mode: "byte" },
  ];

  const handleOCR = async () => {
    async function create(dataForQRcode, center_image, width, cwidth) {
      const canvas = createCanvas(width, width);

      await QRCode.toCanvas(canvas, dataForQRcode, {
        errorCorrectionLevel: "H",
        margin: 1,
        color: {
          dark: "#000000",
          light: "#ffffff",
        },
      });

      const ctx = canvas.getContext("2d");
      const img = await loadImage(center_image);
      const center = width / 2 - cwidth;

      ctx.drawImage(img, center, center, cwidth, cwidth);
      return canvas.toDataURL("image/png");
    }

    console.log(pngUrl);

    const pngImg = `data:image/png;base64, ${pngUrl}`;

    const qrCodeDataURL = await create("https://google.com", pngImg, 500, 50);

    // Use qrCodeDataURL as needed (e.g., display in an <img> tag or save to file)
    console.log(qrCodeDataURL);
    setBase64(qrCodeDataURL);
  };

  // Call handleOCR to initiate the process
  // handleOCR();

  return (
    <div className="flex flex-col items-center justify-center space-y-6">
      <button
        className="px-4 py-2 bg-blue-500 text-white rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 focus:ring-offset-2 disabled:opacity-50 disabled:cursor-not-allowed"
        onClick={handleOCR}
      >
        Generate QR
      </button>
      <img src={base64} alt="" />
    </div>
  );
}
